INSERT INTO `wp_posts` VALUES (12,1,'2025-02-01 01:56:38','2025-02-01 01:56:38','<!-- wp:shortcode -->\n[smartslider3 slider=\"2\"]\n<!-- /wp:shortcode -->\n\n<!-- wp:spacer {\"height\":\"78px\"} -->\n<div style=\"height:78px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:columns {\"className\":\"custom-column-gap-23\",\"style\":{\"spacing\":{\"blockGap\":{\"top\":\"0\",\"left\":\"0\"}}}} -->\n<div class=\"wp-block-columns custom-column-gap-23\"><!-- wp:column {\"width\":\"30px\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:30px\"><!-- wp:image {\"id\":166,\"width\":\"30px\",\"height\":\"auto\",\"aspectRatio\":\"1\",\"scale\":\"contain\",\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full is-resized\"><img src=\"http://jcubsb.local/wp-content/uploads/2025/02/Polygon-1-1.png\" alt=\"\" class=\"wp-image-166\" style=\"aspect-ratio:1;object-fit:contain;width:30px;height:auto\"/></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"66.66%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:66.66%\"><!-- wp:paragraph -->\n<p>Current Student Board Members</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p>The JCU Brisbane Student Board (JCUBSB) is an organisation led by a team of student leaders who form a bridge of communication<br>between JCUB students and staff and aim to provide representation and support to all members.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>JCUBSB offers a free and confidential Advocacy Service where you can get advice regarding any academic concerns or even just general information about how the university operates. Members also get access to social clubs and events, and receive discounts from a number of participating businesses.</p>\n<!-- /wp:paragraph -->','Home page','','trash','closed','closed','','home-page__trashed','','','2025-02-20 20:54:06','2025-02-20 20:54:06','',0,'http://jcubsb.local/?page_id=12',0,'page','',0);
