->\n\n<!-- wp:paragraph {\"className\":\"is-style-default\",\"fontSize\":\"small\"} -->\n<p class=\"is-style-default has-small-font-size\"><strong>Published:&nbsp;30 Jan 2025</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|contrast\"}}}},\"textColor\":\"contrast\",\"fontSize\":\"medium\"} -->\n<p class=\"has-contrast-color has-text-color has-link-color has-medium-font-size\">From the 26th to the 30th of Jan, JCU Brisbane joined JCU Townsville and Cairns on the road for the Brisbane Showcase.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|accent-3\"}}}},\"textColor\":\"accent-3\",\"fontSize\":\"small\"} -->\n<p class=\"has-accent-3-color has-text-color has-link-color has-small-font-size\"><strong><a href=\"http://jcubsb.local/jcub-career-fair/\">Read more...</a></strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":98,\"width\":\"408px\",\"height\":\"auto\",\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full is-resized\"><img src=\"http://jcubsb.local/wp-content/uploads/2025/02/job-1.jpg\" alt=\"\" class=\"wp-image-98\" style=\"width:408px;height:auto\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|accent-3\"}}}},\"textColor\":\"accent-3\",\"fontSize\":\"medium\"} -->\n<p class=\"has-accent-3-color has-text-color has-link-color has-medium-font-size\"><strong>JCUB Career Fair</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"small\"} -->\n<p class=\"has-small-font-size\"><strong>Published:</strong>&nbsp;<strong>10 Dec 2024</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">The Career Fair, organised by the Joblinx Department and held at Student One, was a resounding success, drawing 170 attendees and representatives from 18 businesses.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|accent-3\"}}}},\"textColor\":\"accent-3\",\"fontSize\":\"small\"} -->\n<p class=\"has-accent-3-color has-text-color has-link-color has-small-font-size\"><strong><a href=\"http://jcubsb.local/jcub-career-fair-2/\">Read more...</a></strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":99,\"width\":\"421px\",\"height\":\"auto\",\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full is-resized\"><img src=\"http://jcubsb.local/wp-content/uploads/2025/02/bridge-1.jpg\" alt=\"\" class=\"wp-image-99\" style=\"width:421px;height:auto\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|accent-3\"}}}},\"textColor\":\"accent-3\",\"fontSize\":\"medium\"} -->\n<p class=\"has-accent-3-color has-text-color has-link-color has-medium-font-size\"><strong>Story Bridge Adventure</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"small\"} -->\n<p class=\"has-small-font-size\"><strong>Published:&nbsp;20 Nov 2024</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">A group of our new students, together with members of the Student Association went on the Story Bridge Adventure climb.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|accent-3\"}}}},\"textColor\":\"accent-3\",\"fontSize\":\"small\"} -->\n<p class=\"has-accent-3-color has-text-color has-link-color has-small-font-size\"><strong><a href=\"http://jcubsb.local/story-bridge-adventure/\">Read more...</a></strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":100,\"width\":\"424px\",\"height\":\"auto\",\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://jcubsb.local/wp-content/uploads/2025/02/moreton-1-1024x768.jpg\" alt=\"\" class=\"wp-image-100\" style=\"width:424px;height:auto\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|accent-3\"}}}},\"textColor\":\"accent-3\",\"fontSize\":\"medium\"} -->\n<p class=\"has-accent-3-color has-text-color has-link-color has-medium-font-size\"><strong>Mindfulness Leadership Workshop</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"small\"} -->\n<p class=\"has-small-font-size\"><strong>Published:&nbsp;30 Oct 2024</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"medium\"} -->\n<p class=\"has-medium-font-size\">JCUB student truly enjoyed the Mindful Leadership Workshop on Moreton Island.&nbsp;<img height=\"16\" width=\"16\" alt=\"🌴\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tec/1/16/1f334.png\">&nbsp;Event attendees learnt the concept about the New Leadership and had lots of fun riding quads on the second half of the day.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|accent-3\"}}}},\"textColor\":\"accent-3\",\"fontSize\":\"small\"} -->\n<p class=\"has-accent-3-color has-text-color has-link-color has-small-font-size\"><strong><a href=\"http://jcubsb.local/mindfulness-workshop/\">Read more...</a></strong></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','News and Updates','','trash','closed','closed','','news-and-updates__trashed','','','2025-03-11 09:56:34','2025-03-10 23:56:34','',0,'http://jcubsb.local/?page_id=91',0,'page','',0);
