-->\n\n<!-- wp:paragraph {\"className\":\"is-style-default\",\"fontSize\":\"small\"} -->\n<p class=\"is-style-default has-small-font-size\"><strong>Published:&nbsp;30 Jan 2025</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|contrast\"}}}},\"textColor\":\"contrast\",\"fontSize\":\"medium\"} -->\n<p class=\"has-contrast-color has-text-color has-link-color has-medium-font-size\">From the 6th to the 9th of March, JCU Brisbane joined JCU Townsville and Cairns on the road for the Brisbane Showcase. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|contrast\"}}}},\"fontSize\":\"medium\"} -->\n<p class=\"has-link-color has-medium-font-size\">10 Queensland and interstate universities&nbsp;along with representatives from&nbsp;Queensland Tertiary Admissions Centre (QTAC) and&nbsp;TAFE Queensland visited multiple local high schools across Brisbane to&nbsp;present options and information regarding&nbsp;post-school study.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|contrast\"}}}},\"textColor\":\"contrast\",\"fontSize\":\"medium\"} -->\n<p class=\"has-contrast-color has-text-color has-link-color has-medium-font-size\">Thank you to all the local schools that hosted the Brisbane Showcase. It was a fantastic week, having the opportunity to showcase what James Cook University can offer your students in the future studies!</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','Brisbane Showcase','','trash','closed','closed','','jcub-career-fair__trashed','','','2025-02-24 09:27:47','2025-02-23 23:27:47','',0,'http://jcubsb.local/?p=103',0,'post','',0);
