ph -->\n\n<!-- wp:paragraph {\"className\":\"is-style-default\",\"fontSize\":\"small\"} -->\n<p class=\"is-style-default has-small-font-size\"><strong>Published: </strong><strong>10 Dec 2024</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|contrast\"}}}},\"fontSize\":\"medium\"} -->\n<p class=\"has-link-color has-medium-font-size\">The Career Fair, organised by the Joblinx Department and held at Student One, was a resounding success, drawing 170 attendees and representatives from 18 businesses.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|contrast\"}}}},\"textColor\":\"contrast\",\"fontSize\":\"medium\"} -->\n<p class=\"has-contrast-color has-text-color has-link-color has-medium-font-size\">The event offered students and alumni a valuable platform to connect with industry professionals, explore career opportunities, and build professional networks. With strong student engagement and enthusiastic business participation, the fair showcased the importance of collaboration between universities and industry partners in supporting student career development. Positive feedback from both participants and employers highlighted the event’s success in enhancing student employability.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','JCUB Career Fair','','trash','closed','closed','','jcub-career-fair-2__trashed','','','2025-02-24 09:27:47','2025-02-23 23:27:47','',0,'http://jcubsb.local/?p=117',0,'post','',0);
INSERT INTO `wp_posts` VALUES (121,1,'2025-02-13 09:58:59','2025-02-13 09:58:59','<!-- wp:columns {\"align\":\"wide\"} -->\n<div class=\"wp-block-columns alignwide\"><!-- wp:column {\"width\":\"33.33%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:33.33%\"><!-- wp:details {\"style\":{\"color\":{\"background\":\"#6c53dc\"},\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|base\"}}},\"spacing\":{\"blockGap\":\"var:preset|spacing|20\"}},\"textColor\":\"base\",\"fontSize\":\"x-large\"} -->\n<details class=\"wp-block-details has-base-color has-text-color has-background has-link-color has-x-large-font-size\" style=\"background-color:#6c53dc\"><summary>News and Updates</summary><!-- wp:paragraph {\"placeholder\":\"Type / to add a hidden block\"} -->\n<p><strong><a href=\"http://jcubsb.local/home-page/\" data-type=\"page\" data-id=\"12\">Home</a></strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"fontSize\":\"x-large\"} -->\n<p class=\"has-x-large-font-size\"><strong><a href=\"https://www.jcu.edu.au/brisbane\" data-type=\"link\" data-id=\"https://www.jcu.edu.au/brisbane\">JCU Brisbane</a></strong></p>\n<!-- /wp:paragraph --></details>\n<!-- /wp:details --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":\"66.66%\"} -->\n<div class=\"wp-block-column\" style=\"flex-basis:66.66%\"><!-- wp:image {\"id\":122,\"width\":\"796px\",\"height\":\"auto\",\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full is-resized\"><img src=\"http://jcubsb.local/wp-content/uploads/2025/02/moreton-2.jpg\" alt=\"\" class=\"wp-image-122\" style=\"width:796px;height:auto\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|accent-3\"}}}},\"textColor\":\"accent-3\",\"fontSize\":\"medium\"} -->\n<p class=\"has-accent-3-color has-text-color has-link-color has-medium-font-size\"><strong>Mindfulness Leadership Workshop</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Published:&nbsp;30 Oct 2024</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|contrast\"}}}},\"textColor\":\"contrast\",\"fontSize\":\"medium\"} -->\n<p class=\"has-contrast-color has-text-color has-link-color has-medium-font-size\">JCUB student truly enjoyed the Mindful Leadership Workshop on Moreton Island. <img height=\"16\" width=\"16\" src=\"https://static.xx.fbcdn.net/images/emoji.php/v9/tec/1/16/1f334.png\" alt=\"🌴\"> Event attendees learnt the concept about the New Leadership and had lots of fun riding quads on the second half of the day.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|contrast\"}}}},\"textColor\":\"contrast\",\"fontSize\":\"medium\"} -->\n<p class=\"has-contrast-color has-text-color has-link-color has-medium-font-size\">Students learnt all about the Science of Management and Art of the Leadership</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"style\":{\"elements\":{\"link\":{\"color\":{\"text\":\"var:preset|color|contrast\"}}}},\"textColor\":\"contrast\",\"fontSize\":\"medium\"} -->\n<p class=\"has-contrast-color has-text-color has-link-color has-medium-font-size\">Keep an eye on our upcoming events!</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->','Mindfulness Workshop','','trash','closed','closed','','mindfulness-workshop__trashed','','','2025-02-24 09:27:47','2025-02-23 23:27:47','',0,'http://jcubsb.local/?p=121',0,'post','',0);
