INSERT INTO `wp_posts` VALUES (274,1,'2025-02-27 11:03:07','2025-02-27 01:03:07','<img width=\"46\" height=\"52\" src=\"http://jcubsb.local/wp-content/uploads/2025/02/image-1.png\" alt=\"\" />															\n					<h4>Current Student Board Memebers</h4>				\n		<p>The JCU Brisbane Student Board (JCUBSB) is an organisation led by a team of student leaders who form a bridge of communication <br />between JCUB students and staff and aim to provide representation and support to all members.</p><p>JCUBSB offers a free and confidential Advocacy Service where you can get advice regarding any academic concerns or even just general information about how the university operates. Members also get access to social clubs and events and receive discounts from a number of participating businesses.</p>		\n							<ul>\n							<li>\n							<svg aria-hidden=\"true\" viewBox=\"0 0 192 512\" xmlns=\"http://www.w3.org/2000/svg\"><path d=\"M0 384.662V127.338c0-17.818 21.543-26.741 34.142-14.142l128.662 128.662c7.81 7.81 7.81 20.474 0 28.284L34.142 398.804C21.543 411.404 0 402.48 0 384.662z\"></path></svg>						\n										Know more about Student Board\n									</li>\n								<li>\n							<svg aria-hidden=\"true\" viewBox=\"0 0 192 512\" xmlns=\"http://www.w3.org/2000/svg\"><path d=\"M0 384.662V127.338c0-17.818 21.543-26.741 34.142-14.142l128.662 128.662c7.81 7.81 7.81 20.474 0 28.284L34.142 398.804C21.543 411.404 0 402.48 0 384.662z\"></path></svg>						\n										What’s New?\n									</li>\n								<li>\n							<svg aria-hidden=\"true\" viewBox=\"0 0 192 512\" xmlns=\"http://www.w3.org/2000/svg\"><path d=\"M0 384.662V127.338c0-17.818 21.543-26.741 34.142-14.142l128.662 128.662c7.81 7.81 7.81 20.474 0 28.284L34.142 398.804C21.543 411.404 0 402.48 0 384.662z\"></path></svg>						\n										Upcoming Events\n									</li>\n								<li>\n							<svg aria-hidden=\"true\" viewBox=\"0 0 192 512\" xmlns=\"http://www.w3.org/2000/svg\"><path d=\"M0 384.662V127.338c0-17.818 21.543-26.741 34.142-